 //config.headers.token='123'\n    // \u8fd9\u91cc\u7684\u914d\u7f6e\u5bf9\u8c61\u8fd8\u9700\u8981\u8fdb\u884c\u8fd4\u56de\uff0c\u5982\u679c\u4e0d\u8fdb\u884c\u8fd4\u56de\u53ef\u80fd\u5230\u65f6\u5019\u8bf7\u6c42\u4e5f\u53d1\u9001\u4e0d\u51fa\u53bb\u3002\n    return config\n})\n\n// \u5c01\u88c5\u54cd\u5e94\u62e6\u622a\u5668\n// \u54cd\u5e94\u62e6\u622a\u5668\u4f1a\u6709\u4e24\u4e2a\u56de\u8c03\uff0c\u4e00\u4e2a\u662f\u6210\u529f\u7684\u56de\u8c03\u4e00\u4e2a\u662f\u5931\u8d25\u7684\u56de\u8c03\nrequest.interceptors.response.use((response) => {\n    // \u6210\u529f\u7684\u8bdd\u5c31\u5c06\u670d\u52a1\u5668\u91cc\u7684\u6570\u636e\u8fdb\u884c\u8fd4\u56de\n    // \u7b80\u5316\u6570\u7ec4\n    // \u56e0\u4e3a\u6210\u529f\u7684\u8bdd\u4f1a\u8fd4\u56de\u72b6\u6001\u7801\u548c\u6570\u636e\uff0c\u5728\u8fd9\u91cc\u6211\u4eec\u53ea\u9700\u8981\u8fd4\u56de\u6570\u636e\u5373\u53ef\n    return response.data\n}, (error) => {\n    // \u5931\u8d25\u7684\u56de\u8c03\uff0c\u4e00\u822c\u5904\u7406Http\u7684\u7f51\u7edc\u9519\u8bef\n    // \u5b9a\u4e49\u4e00\u4e2a\u53d8\u91cf\uff0c\u7528\u6765\u5b58\u50a8\u7f51\u7edc\u9519\u8bef\u7684\u4fe1\u606f\n    let message = ''\n    // http\u72b6\u6001\u7801\n    let status = error.resonse.status\n    switch (status) {\n        case 401:\n            message: \"token\u8fc7\u671f\";\n            break;\n        case 403:\n            message: \"\u65e0\u6743\u8bbf\u95ee\";\n            break;\n        case 404:\n            message: \"\u8bf7\u6c42\u5730\u5740\u9519\u8bef\";\n            break;\n        case 500:\n            message: \"\u670d\u52a1\u5668\u51fa\u73b0\u95ee\u9898\";\n            break;\n        default:\n            message:\"\u7f51\u7edc\u51fa\u73b0\u95ee\u9898\";\n            break;\n    }\n    // \u63d0\u793a\u9519\u8bef\u4fe1\u606f \u7528\u4e86\u4e00\u4e2aelement\u7ec4\u4ef6\n    ElMessage({\n        type:'error',\n        // kv\u4e00\u81f4\u7701\u7565v\n        message\n    })\n    // \u8fd4\u56de\u5931\u8d25\u7684Promise\u5b